X 很自豪能够资助安大略省重症监护医师兼教授 Matthew Strauss 博士对其前雇主皇后大学提起的诉讼。

在 Strauss 博士反对广泛的新冠病毒封锁和对其 X 帐户的强制要求后，@strauss_matt，女王大学 ( @queensu) 公开排斥他、报复他，并最终迫使他辞职，因为他的观点不符合他的要求。符合大学的政治正统。 

@X 支持施特劳斯博士为维护他的言论自由权所做的努力，而不必担心遭到不公平的报复！
